import Link from 'next/link';

const Header = () => {
  return (
    <header>
      <nav>
        <ul style={linkStyle}>
          <li style={{marginRight: '1rem'}}><Link href="/">Home</Link></li>
          <li><Link href="/about">About</Link></li>
          <li><Link href="/contact">Contact</Link></li>
        </ul>
      </nav>
    </header>
  )
}

const linkStyle = {
  display: 'flex',
  listStyle: 'none'
}

export default Header;
